i.cn//typoraaNklb_f6N41DI05eOgyYdlYNRf-KbmFsWlWltwLbY18.png" alt="image"></p><p><strong>开始安装了，根据网络情况，安装时间可能会比较长，请耐心等待</strong></p><p><img src="https://picgo.xingenhi.cn//typorawoz79ALiHILNG9CwSFfCxnS13RV4ibFZLkkx9CdKD0M.png" alt="image"></p><p><strong>很多插件装不上怎么办？不要慌，记住这些插件的名字，咱们稍后可以手动安装</strong></p><p><img src="https://picgo.xingenhi.cn//typorabeIRNSx70ZHus3YZd5XYdvHj8TBpIuZ0cxBYvR7lhww.png" alt="image"></p><h2 id="四、安装成功效果图" tabindex="-1"><a class="header-anchor" href="#四、安装成功效果图" aria-hidden="true">#</a> 四、安装成功效果图</h2><ul><li>创建管理员</li></ul><p><img src="https://picgo.xingenhi.cn//typoraj3RpBMMalOVx8MiVbFkiYrAXfh8abkcDQ9Oagp_Und4.png" alt="image"></p><ul><li>安装完成，进入首页</li></ul><p><img src="https://picgo.xingenhi.cn//typoraIkEDy7lG9ppqFGocqwS_bBI4ohIfZucpc973w0Ycr-8.png" alt="image"></p><h2 id="五、附-jenkins-手动安装插件" tabindex="-1"><a class="header-anchor" href="#五、附-jenkins-手动安装插件" aria-hidden="true">#</a> 五、附：Jenkins 手动安装插件</h2><h3 id="_1、使用插件管理器安装" tabindex="-1"><a class="header-anchor" href="#_1、使用插件管理器安装" aria-hidden="true">#</a> 1、使用插件管理器安装</h3><ul><li><code>Manage Jenkins</code> -&gt; <code>Manage Plugins</code> -&gt; <code>Avaliable</code></li></ul><p><img src="https://picgo.xingenhi.cn//typoralVJ6K1SRnyX4udfKxw87WRvB5KR2-mPs61ByqhJjQtY.png" alt="image"></p><ul><li>过滤出想要安装的插件，然后点击 <code>Download now and install after restart</code></li></ul><p><img src="https://picgo.xingenhi.cn//typoraH9lfLS03Db7SRUtVs8cyDKDU5Whf-ydHFYmZaxLTu8A.png" alt="image"></p><p><img src="https://picgo.xingenhi.cn//typoraPGKFe99jArswNM_cQIGf2nqWOnOZVXdAgyDZsSykpu0.png" alt="image"></p><h3 id="_2、手动上传-hpi-文件" tabindex="-1"><a class="header-anchor" href="#_2、手动上传-hpi-文件" aria-hidden="true">#</a> 2、手动上传 <code>.hpi</code> 文件</h3><ul><li>点击进入插件中心</li></ul><p><img src="https://picgo.xingenhi.cn//typorajZ4j1p_IqJAzbYICtfk6ZK_SqLG_vOfo8HlX3CzAUW8.png" alt="image"></p><ul><li>点击 <code>Archives</code></li></ul><p><img src="https://picgo.xingenhi.cn//typoraAguZRT_EyYFhhwOyGWiAuOyNDTE_q9HAigsANFz9enQ.png" alt="image"></p><ul><li>下载需要的版本</li></ul><p><img src="https://picgo.xingenhi.cn//typoraVqkpazH1FqFTcoCKtzVcfES0YmCzWNZOpBj_IMs3SRU.png" alt="image"></p><ul><li>在插件管理器中选择 <code>Advanced</code></li></ul><p><img src="https://picgo.xingenhi.cn//typora7Q3URpKxMlM1p_-dfdCwlReoBAuL9uGhTlk6NCcTBqI.png" alt="image"></p><ul><li>选择上传即可</li></ul><p><img src="https://picgo.xingenhi.cn//typoraMYsqd4JMb26Y3XvurbDSpjOmFLzF36Dkwy5I6gBCb60.png" alt="image"></p><h3 id="_3、重启-jenkins" tabindex="-1"><a class="header-anchor" href="#_3、重启-jenkins" aria-hidden="true">#</a> 3、重启 Jenkins</h3><div class="language-Plain line-numbers-mode" data-ext="Plain"><pre class="language-Plain"><code>docker-compose down
